import Profile from "./components/Profile";

const persons = [
  {
    name: "Geo",
    age: 18,
    Hobbies: ["sports", "music"],
  },
  {
    name: "Tom",
    age: 25,
    Hobbies: ["movie", "music"],
  },
  {
    name: "Lisa",
    age: 21,
    Hobbies: ["sports","travel", ""],
  },
];

const Example = () => {
  return (
    <>
      <ul>
        {}
        {/* <Profile { ...persons}/> */}
        <Profile name="Geo" age="18" hobbies={["sports", "music"]}/>
      </ul>
    </>
  );
};

export default Example;
